/* ==UserStyle==
@name           Google：ホリデーロゴ置換
@namespace      sachi-web.com
@author         uminosachi
@description    `Google検索のホリデーロゴ（Doodle）を通常のロゴに置き換えます。日本向けのため google.co.jp, google.com で有効です。PC版ウェブサイト用です。`
@version        20220410
@homepageURL    https://at.sachi-web.com/blog-entry-1461.html
@updateURL      https://userstyles.world/api/style/4100.user.css
@license        CC-BY-NC-SA-4.0
==/UserStyle== */

/*---------------------------------------------------------
URL: https://at.sachi-web.com/blog-entry-1461.html
                                   last update: 2022/04/10
---------------------------------------------------------*/

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url("https://www.google.co.jp/"), url("https://www.google.com/"), url-prefix("https://www.google.co.jp/?"), url-prefix("https://www.google.co.jp/webhp?"), url-prefix("https://www.google.com/?"), url-prefix("https://www.google.com/webhp?") {
/* top */
img#hplogo
,#hplogo > *
,[name="btnI"] div[role]
,[class*="promo"]
,[title="共有"]
,a[href*="oi=ddle"]:not([data-navigation]) img
{
  display: none !important;
}


#hplogo
,a[href*="oi=ddle"]:not([data-navigation])
{
  display: inline-block !important;
  width: 500px !important;
  height: 233px !important;
  pointer-events: none !important;
  background-size: 272px 92px !important;
  background-repeat: no-repeat !important;
  background-position: center bottom 17px !important;
  background-image: url(data:image/png;base64,) !important;
}
}

@-moz-document url-prefix("https://www.google.co.jp/search?"), url-prefix("https://www.google.com/search?") {
/* search result */

[src*="doodles"]:not([data-atf="false"])
,#logo [src*="/googlelogo/"]
{
  display: none !important;
}

.logo a{
  display: block !important;
  width: 92px !important;
  height: 33.5px !important;
  background-size: 92px 30px !important;
  background-repeat: no-repeat !important;
  background-position: center top !important;
  background-image: url(data:image/png;base64,) !important;
}

.minidiv .logo a {
  width: 86px !important;
  height: 31.5px !important;
  background-size: 86px 28px !important;
}

}
